import {introdata} from "./content_details";

function Intro() {
    return(
        <div className="font-bold">
            <h1 className="lg:text-4xl sm:text-2xl">{introdata.title}</h1>
            <div className="description lg:text-3xl sm:text-1xl accent-gray-800">
                <p>{introdata.description.first}</p>
                <p>{introdata.description.second}</p>
            </div>
        </div>
    )
}

export default Intro;
